import React from 'react';
import ProcedureStep from '..//ProcedureStep';
import styles from './index.module.css';

const ProcedureSteps = ({steps, onDragEnd, onDragOver, onDragStart}) => steps && steps.length ? (
  <div className={styles.list}>
    {steps.map(step => <ProcedureStep key={step.id} step={step} onDragOver={onDragOver} onDragStart={onDragStart} onDragEnd={onDragEnd} />)}
  </div>
) : (
  <div className={styles.empty}>
    This procedure currently has no steps
  </div>
)

export default ProcedureSteps;
